import React, {useState} from 'react'

interface HeaderProps {
    buttonText: string;
}

export default function Header({buttonText}: HeaderProps) {
    const [count, setCount] = useState(0)

    const handleClick = () => {
        setCount(count + 1)
        console.log(count)
    }

    return (
        <div>
            <h1>Header</h1>
            <button onClick={handleClick}>{buttonText}</button>
            <p>{count}</p>
        </div>
    )
}
